import React from "react";
import { useEffect, useState } from "react";

const Home = () => {
  const [cases, setCases] = useState(0);
  useEffect(() => {
    fetch("/global-data")
      .then((res) => res.json())
      .then((data) => {
        setCases(data[0].confirmed);
      });
  }, []);
  return (
    <div className="HomePage">
      <h1>homepage</h1>
      <h1>{cases}</h1>
    </div>
  );
};

export default Home;
